export const exportPrintLabel = async ({ filename }) => {
    const input = document.getElementById('printlabel');
    const elemet = document.getElementById('canvasPrint');

    html2canvas(input, { scale: 2 }).then((canvas) => {
        const sailecBoldFonts = sailecBoldFont();
        const sailecRegularFonts = sailecRegularFont();
        
        const pdf = new jsPDF('l', 'mm', 'a4');
        pdf.addFileToVFS('Sailec_bold.ttf', sailecBoldFonts);
        pdf.addFileToVFS('Sailec_regular.ttf', sailecRegularFonts);
        pdf.addFont('Sailec_Regular.ttf', 'regular', 'normal');

        pdf.fromHTML(elemet, 15, 15);
        pdf.setFont('Sailec-Bold', 'normal', 'normal');

        pdf.save('download.pdf');
    })
};